import { TypeAnimation } from 'react-type-animation';


export default function Home() {
    return (
        <div className="home-wrap">
            <div className="home-print-container">
                <TypeAnimation
                    sequence={
                    [   1000,
                        "Print('Hello World')",
                        4000,
                        "Print('Hel",
                        200,
                        "Print('Hello, I'm Astonished Orca')",
                        1000,
                    ]}
                    // cursor={true}
                    // wrapper="print-animation"
                    // speed={30}
                />
            </div>
        </div>
    );
}
